atrix(1 0 0 1 44.7124 620.5592)"><tspan x="0" y="0" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">The American crow (Corvus brachyrhynchos) is a large passerine bird species of </tspan><tspan x="0" y="16.2" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">the family Corvidae. It is a common bird found throughout much of North America. </tspan><tspan x="0" y="32.4" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">American crows are the new world counterpart to the carrion crow and the </tspan><tspan x="0" y="48.6" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">hooded crow. Although the American crow and the hooded crow are very similar </tspan><tspan x="0" y="64.8" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">in size, structure and behavior, their calls are different. The American crow never</tspan><tspan x="431.9" y="64.8" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">-</tspan><tspan x="0" y="81" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">theless occupies the same role the hooded crow does in Eurasia.</tspan></text>	</g>	<rect x="37.4" y="55" display="inline" fill="none" width="458.9" height="37"/>			<text id="name" transform="matrix(1 0 0 1 157.4583 77.8237)" display="inline" fill="#603813" font-family="'TwCenMT-Regular'" font-size="36px">American Crow</text>	<rect x="119.7" y="545" display="inline" fill="none" width="294.3" height="28"/>			<text id="scientificName" transform="matrix(1 0 0 1 163.3636 562.0371)" display="inline" fill="#603813" font-family="'Parisienne-Regular'" font-size="26px">Corvus brachyrhynchos</text></g><g id="Descriptions" display="none">			<text id="graphName" transform="matrix(1 0 0 1 539.22 146.9308)" display="inline" fill="#603813" font-family="'TwCenMT-Bold'" font-size="26px">{{   chosenItemInfo[chosenItem].text   }}</text>	<g id="SpeciesNumberDescription" onload="v-show=chosenItem=='Species
